import React from 'react';
import Person from "../assets/sw1.png"

function Contact() {
  return (
    <div className='contact'>
        <div className='leftSide' style={{backgroundImage: `url(${Person})`}}></div>
        <div className='rightSide'></div>
    </div>
  )
}

export default Contact
